require 'minitest/autorun'
require 'twitter_tag_tracker'

describe TwitterTagTracker do

  describe "tag stream" do
    it "yields tags" do
      tag_stream = TwitterTagTracker::TagStream.new(DATA)
      tags = []
      tag_stream.each_tag {|tag| tags << tag}

      tags.count.must_equal 26
      #spot check
      tags.must_include 'vegan'
      tags.must_include 'amazing'
      tags.must_include 'HalaMadrid'
      tags.must_include 'ابن_القيم'
    end
  end
end

__END__
